import React from "react";
import { Grid, TextField } from "@material-ui/core";

export const TextFormField = () => {
  return (
    <Grid item xs={12}>
      <TextField
        fullWidth
        label="Grant Name"
        type="text"
        name="competition_name"
        placeholder="Grant Name"
        value={null}
        onChange={null}
      />
    </Grid>
  );
};
